import React from 'react';
import Navbar from './Navbar';
import Header from './Header';

const Layout = ({ children }) => {
  return (
    <div>
      <Header />
      <Navbar />
      <div style={{ padding: '20px', backgroundColor: '#edf3f7', minHeight: '100vh' }}>
        {children}
      </div>
    </div>
  );
};

export default Layout;
